INSERT INTO `table_news` (`id`, `id_list`, `id_item`, `id_cat`, `id_sub`, `photo`, `options`, `slugvi`, `slugen`, `contenten`, `contentvi`, `descen`, `descvi`, `nameen`, `namevi`, `numb`, `status`, `type`, `date_created`, `date_updated`, `view`, `photo1`, `photo2`) VALUES
(1, 1, 1, 1, 1, 'news-1-1102-6998.jpg', '{\"p\":\"news-1-1102-6998.jpg\",\"w\":270,\"h\":200,\"m\":\"image\\/jpeg\"}', 'nike-gioi-thieu-giay-da-bong-bang-dan-doc-dao', 'nike-introduces-a-unique-taped-soccer-shoe', '&lt;p&gt;Frank Rudy was the first person to have the idea of ​​putting air cushioning in a shoe. His inspiration comes from the night set designs of spacecraft at NASA - where he works every day.&lt;/p&gt;\r\n\r\n&lt;p&gt;Immediately after the idea came up, he approached Nike\'s development department. Realizing the potential of the technology, Nike tried it out with its own shoe, Nike Tailwind, and in 1978. This product had an air cushion inside. However, this air cushion is completely hidden in the shoe.&lt;/p&gt;\r\n\r\n&lt;p&gt;This product did not get much success after its inception and was quickly forgotten. See also: Top 7 of the best shoe cushion technologies by Nike&lt;/p&gt;\r\n', '&lt;p&gt;Frank Rudy là người đầu tiên có ý tưởng đặt đệm khí vào một chiếc giày. Nguồn cảm hứng của anh đến từ những thiết kế bộ đêm của tàu vũ trụ tại NASA - nơi anh làm việc hằng ngày.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ngay sau khi nảy ra ý tưởng này, anh lập tức tiếp cận với bộ phận phát triển của Nike. Nhận thấy tiềm năng của công nghệ, Nike đã thử áp dụng thử với sản phẩm giày của mình là Nike Tailwind và năm 1978.&lt;/p&gt;\r\n\r\n&lt;p&gt;Sản phẩm này có đệm khí ở bên trong. Tuy nhiên, lớp đệm khí này lại ẩn hoàn toàn trong giày. Sau khi ra đời, sản phẩm này không nhận được nhiều sự thành công cho lắm do đó nhanh chóng bị lãng quên.&lt;/p&gt;\r\n\r\n&lt;p&gt;Xem thêm: &lt;a href=&quot;https://thethao247.vn/318-top-7-cong-nghe-dem-giay-ti-do-cua-nike-d177270.html&quot; rel=&quot;dofollow&quot; target=&quot;_blank&quot;&gt;Top 7 công nghệ đệm giày tốt nhất của Nike&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;1987, Nike Air Max 1, đôi giày Air Max đầu tiên ra đời&lt;/p&gt;\r\n\r\n&lt;p&gt;&lt;a data-at-1366=&quot;https://media.thethao247.vn/origin_1366x0/upload/thanhtung/2019/04/08/air-max-1-nike-air-max.jpg&quot; data-at-1920=&quot;https://media.thethao247.vn/origin_1920x0/upload/thanhtung/2019/04/08/air-max-1-nike-air-max.jpg&quot; data-at-450=&quot;https://media.thethao247.vn/origin_450x0/upload/thanhtung/2019/04/08/air-max-1-nike-air-max.jpg&quot; data-at-800=&quot;https://media.thethao247.vn/origin_800x0/upload/thanhtung/2019/04/08/air-max-1-nike-air-max.jpg&quot; data-caption=&quot;&quot; href=&quot;https://media.thethao247.vn/origin_850x0/upload/thanhtung/2019/04/08/air-max-1-nike-air-max.jpg&quot;&gt;&lt;img alt=&quot;&quot; data-ll-status=&quot;loading&quot; src=&quot;https://media.thethao247.vn/origin_850x0/upload/thanhtung/2019/04/08/air-max-1-nike-air-max.jpg&quot; title=&quot;&quot; /&gt;&lt;/a&gt;&lt;/p&gt;\r\n\r\n&lt;p&gt;Nike Air Max 1 (ảnh: sneakerfreaker.com)&lt;/p&gt;\r\n\r\n&lt;p&gt;Tinker Hatfield - nhà thiết kế chính của Nike, được coi là cha đẻ của Air Max và là người đưa những bộ đệm này trở nên có thể nhìn thấy được.&lt;/p&gt;\r\n\r\n&lt;p&gt;Ông nảy ra ý tưởng đưa lớp đệm Air có thể nhìn thấy được quan sát những lớp kính của Trung tâm triển lãm Pompidou Centre tại Paris. Ngày sau khi trở về Mỹ ông bắt tay vào thiết kế bộ đệm với càng nhiều không khí càng tốt. Từ đây, thuật ngữ &quot;không khí tối đa&quot; Maximum Air được gọi tắt là Air Max ra đời.&lt;/p&gt;\r\n\r\n&lt;p&gt;Năm 1987, sản phẩm Nike Air Max 1 ra đời. Với bộ đệm khí có thể nhìn thấy ở đế giày. Ngay lập tức đôi giày đem lại sự chú ý của thị trường và bán rất chạy.&lt;/p&gt;\r\n\r\n&lt;p&gt;Trong những năm sau đó, Nike tiếp tục nỗ lực để cải tiến bộ đệm này với mục tiêu đệm càng nhiều khí càng tốt. 3 phiên bản Air Max ra đời trong thời gian này là Air Max 90 (1990), Air Max 180 (1991), Air Max 93 (1993).&lt;/p&gt;\r\n\r\n&lt;p&gt;Tuy nhiên tại thời điểm này, tất cả các mẫu đều có bộ đệm khí chỉ có thể được đặt ở phần gót giày. Điều đồng nghĩa với phần mũi và giữa bàn chân vẫn chưa được bảo vệ với đệm không khí.&lt;/p&gt;\r\n', 'The Nike Phantom GT are soccer boots created from the analysis of large amounts of data from players and unique tape technology.', 'Nike Phantom GT là đôi giày đá bóng được tạo ra từ sự phân tích một lượng lớn dữ liệu từ các cầu thủ và công nghệ băng dán độc đáo.', 'Nike introduces a unique taped soccer shoe', 'Nike giới thiệu giày đá bóng băng dán độc đáo', 1, 'hienthi,noibat', 'tin-tuc', 1609287033, 1641176921, 51, NULL, NULL),
