ts of data from players and unique tape technology.', 'Nike Phantom GT là đôi giày đá bóng được tạo ra từ sự phân tích một lượng lớn dữ liệu từ các cầu thủ và công nghệ băng dán độc đáo.', 'Close-up of Nike Airmax 97 with unique smart shoelaces', 'Cận cảnh Nike Airmax 97 với dây giày thông minh cực độc', 4, 'noibat,hienthi', 'tin-tuc', 1609287457, 1625552408, 0, NULL, NULL),
