(180, 1, 'news', 'man', 'tin-tuc', 'Nike giới thiệu giày đá bóng băng dán độc đáo', 'Nike giới thiệu giày đá bóng băng dán độc đáo', 'Nike Phantom GT là đôi giày đá bóng được tạo ra từ sự phân tích một lượng lớn dữ liệu từ các cầu thủ và công nghệ băng dán độc đáo.', 'Nike introduces a unique taped soccer shoe', 'Nike introduces a unique taped soccer shoe', 'The Nike Phantom GT are soccer boots created from the analysis of large amounts of data from players and unique tape technology.', NULL, NULL),
(164, 2, 'news', 'man', 'tin-tuc', 'Nike Zoom công nghệ đệm giày thành công nhất của Nike', 'Nike Zoom công nghệ đệm giày thành công nhất của Nike', 'Nike Phantom GT là đôi giày đá bóng được tạo ra từ sự phân tích một lượng lớn dữ liệu từ các cầu thủ và công nghệ băng dán độc đáo.', 'Nike Zoom Nike\'s most successful shoe cushioning technology', 'Nike Zoom Nike\'s most successful shoe cushioning technology', 'The Nike Phantom GT are soccer boots created from the analysis of large amounts of data from players and unique tape technology.', NULL, NULL),
(165, 3, 'news', 'man', 'tin-tuc', 'Gã khổng lồ Nike đóng cửa hàng loạt ở Trung Quốc vì corona', 'Gã khổng lồ Nike đóng cửa hàng loạt ở Trung Quốc vì corona', 'Nike Phantom GT là đôi giày đá bóng được tạo ra từ sự phân tích một lượng lớn dữ liệu từ các cầu thủ và công nghệ băng dán độc đáo.', 'Giant Nike mass stores in China because of corona', 'Giant Nike mass stores in China because of corona', 'The Nike Phantom GT are soccer boots created from the analysis of large amounts of data from players and unique tape technology.', NULL, NULL),
(166, 4, 'news', 'man', 'tin-tuc', 'Cận cảnh Nike Airmax 97 với dây giày thông minh cực độc', 'Cận cảnh Nike Airmax 97 với dây giày thông minh cực độc', 'Nike Phantom GT là đôi giày đá bóng được tạo ra từ sự phân tích một lượng lớn dữ liệu từ các cầu thủ và công nghệ băng dán độc đáo.', 'Close-up of Nike Airmax 97 with unique smart shoelaces', 'Close-up of Nike Airmax 97 with unique smart shoelaces', 'The Nike Phantom GT are soccer boots created from the analysis of large amounts of data from players and unique tape technology.', NULL, NULL),
